import math
from collections import defaultdict
class DSU:
    def __init__(self,N):
        self.p  = list(range(N))
        self.rank = [1]*N
    
    def find(self,x):
        if self.p[x] != x:
            self.p[x] =self.find(self.p[x])
        return self.p[x]
    
    def union(self,x,y):
        xr = self.find(x)
        yr = self.find(y)
        if self.rank[xr] <self.rank[yr]:
            xr,yr =yr,xr
        
        self.p[yr] = xr
        if self.rank[xr] == self.rank[yr]:
            self.rank[xr] += 1

class Solution:
    def gcdSort(self, nums) :
        st = sorted(nums)
        NUM =100001
        set = [0] *NUM
        visited = [0] *NUM

        for n in nums:
            set[n] =1
        vSet = DSU(NUM)

        for i in range(2,100000):
            if visited[i] ==0:
                for j in range(i,100000,i):
                    visited[j] =1
                    if set[j] >0:
                        vSet.union(i,j)
        n = len(nums)
        for i in range(n):
            if nums[i] != st[i]:
                if vSet.find(nums[i]) != vSet.find(st[i]):
                    return False
        return True
            
            

        

